import React from 'react';
import { useRoutes } from "react-router-dom";


import LoginGuard from 'src/components/LoginGuard';
import RouterGuard from 'src/components/RouterGuard';
import DashboardLayout from 'src/layouts/DashboardLayout';

import MenuView from 'src/views/errors/NotFoundView';
import CompanyInfoView from 'src/views/menu/CompanyInfoView';


export default function routes() {
  let routes: RouteObject[] = [
    {
      path: "/",
      element: <Layout />,
      children: [
        { index: true, element: <Home /> },
        {
          path: "/courses",
          element: <Courses />,
          children: [
            { index: true, element: <CoursesIndex /> },
            { path: "/courses/:id", element: <Course /> },
          ],
        },
        { path: "*", element: <NoMatch /> },
      ],
    },
  ];

  // The useRoutes() hook allows you to define your routes as JavaScript objects
  // instead of <Routes> and <Route> elements. This is really just a style
  // preference for those who prefer to not use JSX for their routes config.
  let element = useRoutes(routes);

  return (
    <div>
      {element}
    </div>
  );
}


